import React from 'react';
import { useState } from 'react';
import axios from 'axios';

const RegisterForm = () => {
  const [participantName, setParticipantName] = useState('');
  const [joinDate, setJoinDate] = useState('');
  const [birthday, setBirthday] = useState('');
  const [contactNo, setContactNo] = useState('');
  const [gender, setGender] = useState('');
  const [member, setMember] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();
    const newMember = { participantName, joinDate, birthday, contactNo, gender };
    setMember(newMember);
    console.log(newMember);
    console.log(member); // This will print the member object to the console
    //const response = await axios.post('/members', member);
    //console.log(response.data);
  };
  return (
    <form onSubmit={handleSubmit} className="register-form">
        <header className="header">
          <h1 className="title">Register</h1>
        </header>
      <label className="attach-photo">
        <input type="file" accept="image/*" style={{ display: 'none' }} />
        <button>Attach Photo ✏️</button>
      </label>
      <div className="form-row">
        <div className="form-group">
          <label>Name of Participant</label>
          <input type="text" />
        </div>
        <div className="form-group">
          <label>Date of Join</label>
          <input type="date" />
        </div>
      </div>
      <div className="form-row">
        <div className="form-group">
          <label>Birthday</label>
          <input type="date" />
        </div>
        <div className="form-group">
          <label>Contact No.</label>
          <input type="tel" />
        </div>
      </div>
      <div className="form-row">
        <div className="form-group">
          <label>Sexe</label>
          <select>
            <option value="male">Male</option>
            <option value="female">Female</option>
            <option value="other">Other</option>
          </select>
        </div>
        <div className="form-group">
          <label>Role</label>
          <input type="text" />
        </div>
      </div>
      <div className="form-actions">
        <button>Coordinate Fingerprint</button>
        <button>Avail Membership</button>
        <button>Cancel</button>
      </div>
      <style jsx>{`
        .register-form {

          background-color: #858585;
          padding: 20px;
          border-radius: 10px;
          width: 80%;
          max-width: 800px;
          margin: auto;
          color: white;
          font-family: Arial, sans-serif;
        }
        h1 {
          color: #ffd700;
        }
        .form-row {
          display: flex;
          justify-content: space-between;
          margin-bottom: 15px;
        }
        .form-group {
          flex: 1;
          margin-right: 20px;
        }
        .form-group:last-child {
          margin-right: 0;
        }
        label {
          display: block;
          margin-bottom: 5px;
        }
        input,
        select,
        button {
          width: 100%;
          padding: 10px;
          border: none;
          border-radius: 5px;
        }
        input[type="date"],
        input[type="tel"],
        input[type="text"] {
          background-color: white;
          color: black;
        }
        select {
          background-color: white;
          color: black;
        }
        button {
          background-color: #ffeb3b;
          color: black;
          cursor: pointer;
          margin-top: 5px;
        }
        .form-actions {
          display: flex;
          justify-content: space-between;
        }
        .form-actions button {
          width: 32%;
        }
        .form-actions button:nth-child(3) {
          background-color: #f44336;
          color: white;
        }
      `}</style>
    </form>
  );
};

export default RegisterForm;
